window.bookSummaryJSON = "<p><b><i>New York Times</i></b><b> bestselling author </b><b><i>Gena Showalter</i></b><b> returns with a new book in the tantalizing </b><b><i>Rise of the Warlords</i></b> <b>series, featuring a brutal Hell king and the irresistible beauty who upends his world. </b><br> <br> For centuries, Rathbone the Only, King of Agonies, has existed for one purpose: recovering the enchanted bones of his slain wife to bring her back to life. He’s never been closer to success. But a new enemy has risen. A band of deadly war gods who have thirty days to destroy her or suffer the consequences. With time running out, Rathbone hires a maddening harpy-oracle, unaware she has an agenda of her own.<br> <br> Neeka the Unwanted is a fierce warrior on a mission: stop Rathbone <i>and </i>the gods. She’s seen the future if either is victorious, and it’s horrifying. She’ll do whatever proves necessary to forge a new path, even seduce the ruthless royal from his purpose. What she can’t predict? How the intense male will shatter her hard-won defenses along the way. <br> <br> As Rathbone battles unexpected betrayals, cunning foes and the wild temptress he craves with every fiber of his being, he knows he must choose: hold on to a cold dream or embrace a new flame.<br> <br> <b>Rise of the Warlords</b></p> <ul> <li><b>Book 1: </b><b><i>The Warlord</i></b></li> <li><b>Book 2: </b><b><i>The Immortal</i></b></li> <li><b>Book 3: </b><b><i>The Phantom</i></b></li> <li><b>Book 4: </b><b><i>The Wrath</i></b></li> </ul>"; 
